import React from "react";

interface InputProp {
  inputEnter(input: string): void;
  displayValue: string;
  setInputDisplay(input: string): void;
}

interface AddColumnButtonProps {
  handleAddColumnAtIndex: (index: number) => void;
  displayValue: string;
  setInputDisplay(input: string): void;
}

export default function AddColumnButton({
  handleAddColumnAtIndex,
  displayValue,
  setInputDisplay,
}: AddColumnButtonProps) {
  return (
    <div className="flex flex-row">
      <button
        className="w-32 h-7 border-2 bg-green-200 border-solid border-zinc-700 text-center"
        onClick={() => handleAddColumnAtIndex(0)}
      >
        Add Column
      </button>
      <input
        type="text"
        className="w-4/5 text-zinc-900 border-2 border-zinc-800 bg-zinc-400 hover:bg-zinc-300 focus:bg-zinc-300 transition duration-90 ease-in-out text-xl h-10"
        onChange={(e) => setInputDisplay(e.target.value)}
        value={displayValue}
      ></input>
    </div>
  );
}
